    render(){
        return (
            <div id="card1" >
            <img src={"../card/blue/strip/one.svg"}
            style={{ width: "50%", height: "50%" }}/>
            <img src={"../card/blue/strip/two.svg"}
            style={{ width: "50%", height: "50%" }}/>
            <img src={"../card/blue/strip/one.svg"}
            style={{ width: "50%", height: "50%" }}/>
            </div>
        )
    }
}

export default Card;
